    `status`         int            DEFAULT NULL COMMENT '' 0:ordercreated, 1
    :
    paied, 2
    :
    delivered, 3
    :
    received
    '',
    `confirm_status` int            DEFAULT NULL COMMENT '' 确认收货状态：0->未确认；1->已确认 '',
